			var delay = ($(this).attr('data-delay')) ? $(this).attr('data-delay') : 0;
			var backSpeed = ($(this).attr('data-backspace-speed')) ? $(this).attr('data-backspace-speed') : 0;
			var shuffle = ($(this).attr('data-shuffle')) ? $(this).attr('data-shuffle') : false;
